insert tempdb.dbo.polygons (polygonShape, color, intensity)
select p.path, cm.sampleIndex, cm.weight
from tempdb.dbo.paths p
join tempdb.dbo.colorMapping cm
	on p.color = cm.html;

DECLARE @sql nvarchar(max) = N'';

with nums as 
(
	select TOP 100 ROW_NUMBER() OVER (ORDER BY (SELECT 1)) n
	from sys.messages
),
polygon_strings as
(
	select replicate('POLYGON((' + polygonShape + ')),', intensity) as shape, color 
	from tempdb.dbo.polygons
	union 
	select 'POLYGON((0 0, 0 1, 1 0, 0 0)),', n
	from nums
),
joined_strings as
(
   select n, ( 
       select shape as [data()] 
	   from polygon_strings
	   where color = n
	   for xml path('') ) as shape
   from nums
)
select @sql = @sql + 'SELECT geometry::STGeomFromText(''GEOMETRYCOLLECTION('
       + left(shape, len(shape)-1)
	   + ')'', 0) ' 
	   + CASE WHEN n = 100 THEN '' ELSE 'UNION ALL ' END
from joined_strings
order by n;

exec sp_executesql @sql;

END -- PROC
